PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE sensorData (_id integer PRIMARY KEY, session_id integer, timestamp date, username text, detectedActivity string, totalStepsToday integer, location text, gps text, gps_lat real, gps_lng real, ambientSound real, wifiName text, bluetooth text, weather integer,screenState int);
CREATE TABLE table_weather ( weather_id INTEGER PRIMARY KEY, weather_json TEXT, weather_timestamp INTEGER);
CREATE TABLE table_realtime_acc ( _id integer PRIMARY KEY, timestamp date, x_axis real , y_axis real , z_axis real , accuracy real );
CREATE TABLE table_realtime_gyro ( _id integer PRIMARY KEY, timestamp date, x_axis real , y_axis real , z_axis real , accuracy real );
CREATE TABLE table_realtime_rot ( _id integer PRIMARY KEY, timestamp date, x_axis real , y_axis real , z_axis real , scalar real );
CREATE TABLE table_realtime_mag ( _id integer PRIMARY KEY, timestamp date, x_axis real , y_axis real , z_axis real , accuracy real );
CREATE TABLE table_geofences ( _id integer PRIMARY KEY, geofenceName text, geofenceLat real, geofenceLong real, geofenceRadius INTEGER, geofenceEnter bool, geofenceExit bool, geofenceDwellInside bool, geofenceDwellOutside bool, geofenceTimestamp time, geofenceLoiteringDelay number, geofenceValidity LONG,geofenceImage INTEGER );
CREATE TABLE table_wifi_geofences ( _id integer PRIMARY KEY, geofenceName text, geofenceBssid String, geofenceRssi INTEGER, geofenceEnter bool, geofenceExit bool, geofenceDwellInside bool, geofenceDwellOutside bool, geofenceLoiteringDelay number );
CREATE TABLE table_jitai_events (_id INTEGER PRIMARY KEY, timestamp DATE, username TEXT, jitai_event INTEGER, jitai_id INTEGER, jitaiMomentRating INTEGER, jitaiTriggerRating INTEGER, jitaiSurveyText TEXT, jitai_sensorDataSet_id INTEGER );
CREATE TABLE table_natural_trigger ( _id INTEGER PRIMARY KEY, natural_trigger_goal TEXT, natural_trigger_message TEXT, natural_trigger_situation TEXT, natural_trigger_geofence INTEGER, natural_trigger_wifi INTEGER, natural_trigger_begin_time TIME, natural_trigger_end_time TIME, natural_trigger_deleted BOOLEAN DEFAULT 0, natural_trigger_active BOOLEAN DEFAULT 1, natural_trigger_activity TEXT, natural_trigger_activity_duration INTEGER );
CREATE TABLE table_geofence_event ( _id INTEGER PRIMARY KEY, timestamp DATE, username TEXT, geofence_id INTEGER, geofenceName TEXT, geofence_event TEXT );
CREATE TABLE table_realtime_light ( _id integer PRIMARY KEY, timestamp date, x_axis real ,accuracy real );
CREATE TABLE table_realtime_proximity ( _id integer PRIMARY KEY, timestamp date, x_axis real ,accuracy real );
CREATE TABLE table_realtime_air ( _id integer PRIMARY KEY, timestamp date, x_axis real ,accuracy real );
CREATE TABLE table_humdity ( _id integer PRIMARY KEY, timestamp date, x_axis real ,accuracy real );
CREATE TABLE table_realtime_temp ( _id integer PRIMARY KEY, timestamp date, x_axis real ,accuracy real );
CREATE INDEX acc_timestamp_index ON table_realtime_acc (timestamp);
CREATE INDEX mag_timestamp_index ON table_realtime_mag (timestamp);
CREATE INDEX gyro_timestamp_index ON table_realtime_gyro (timestamp);
CREATE INDEX air_timestamp_index ON table_realtime_air (timestamp);
CREATE INDEX prox_timestamp_index ON table_realtime_proximity (timestamp);
CREATE INDEX light_timestamp_index ON table_realtime_light (timestamp);
CREATE INDEX sensorDataSet_timestamp_index ON sensorData (timestamp);
COMMIT;
